PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "categories" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "description" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "provinces" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "pst" decimal, "gst" decimal, "hst" decimal, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "admin_users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "active_admin_comments" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "namespace" varchar, "body" text, "resource_type" varchar, "resource_id" integer, "author_type" varchar, "author_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "categories_products" ("category_id" integer NOT NULL, "product_id" integer NOT NULL);
CREATE TABLE "product_categories" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "category_id" integer, "product_id" integer);
CREATE TABLE "order_statuses" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "line_items" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "quantity" integer DEFAULT NULL, "unit_price" decimal DEFAULT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "product_id" integer DEFAULT NULL, "order_id" integer DEFAULT NULL, "total_price" decimal DEFAULT NULL);
CREATE TABLE "products" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar DEFAULT NULL, "description" varchar DEFAULT NULL, "price" decimal DEFAULT NULL, "stock_quantity" integer DEFAULT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "image" varchar DEFAULT NULL);
CREATE TABLE "orders" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "pst_rate" decimal DEFAULT NULL, "gst_rate" decimal DEFAULT NULL, "hst_rate" decimal DEFAULT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "order_status_id" integer DEFAULT NULL, "subtotal" decimal DEFAULT NULL, "total" decimal DEFAULT NULL, "customer_id" integer);
CREATE TABLE "customers" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "address" varchar DEFAULT NULL, "city" varchar DEFAULT NULL, "postal_code" varchar DEFAULT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "province_id" integer DEFAULT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar DEFAULT NULL, "reset_password_sent_at" datetime DEFAULT NULL, "remember_created_at" datetime DEFAULT NULL, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime DEFAULT NULL, "last_sign_in_at" datetime DEFAULT NULL, "current_sign_in_ip" varchar DEFAULT NULL, "last_sign_in_ip" varchar DEFAULT NULL, "failed_attempts" integer DEFAULT 0 NOT NULL, "unlock_token" varchar DEFAULT NULL, "locked_at" datetime DEFAULT NULL, "name" varchar DEFAULT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "index_admin_users_on_email" ON "admin_users" ("email");
CREATE UNIQUE INDEX "index_admin_users_on_reset_password_token" ON "admin_users" ("reset_password_token");
CREATE INDEX "index_active_admin_comments_on_resource_type_and_resource_id" ON "active_admin_comments" ("resource_type", "resource_id");
CREATE INDEX "index_active_admin_comments_on_author_type_and_author_id" ON "active_admin_comments" ("author_type", "author_id");
CREATE INDEX "index_active_admin_comments_on_namespace" ON "active_admin_comments" ("namespace");
CREATE INDEX "index_categories_products_on_category_id_and_product_id" ON "categories_products" ("category_id", "product_id");
CREATE INDEX "index_product_categories_on_category_id" ON "product_categories" ("category_id");
CREATE INDEX "index_product_categories_on_product_id" ON "product_categories" ("product_id");
CREATE INDEX "index_line_items_on_product_id" ON "line_items" ("product_id");
CREATE INDEX "index_line_items_on_order_id" ON "line_items" ("order_id");
CREATE INDEX "index_orders_on_order_status_id" ON "orders" ("order_status_id");
CREATE INDEX "index_customers_on_province_id" ON "customers" ("province_id");
CREATE UNIQUE INDEX "index_customers_on_email" ON "customers" ("email");
CREATE UNIQUE INDEX "index_customers_on_reset_password_token" ON "customers" ("reset_password_token");
CREATE UNIQUE INDEX "index_customers_on_unlock_token" ON "customers" ("unlock_token");
CREATE INDEX "index_orders_on_customer_id" ON "orders" ("customer_id");
COMMIT;
